interface SlideType {
  image: string;
  index: number;
  activeImage: number;
}

const Slide = ({ image, index, activeImage }) => {
  return (
    <li className="carousel__slide-container">
      <input
        type="radio"
        name="radio-buttons"
        id={`img-${index}`}
        checked={activeImage === index}
        readOnly
      />
      <div className="carousel__slide-img">
        <img alt={`scenery ${index}`} src={image} />
      </div>
    </li>
  );
};

export default Slide;
